import React from 'react'
import { AiFillDashboard } from 'react-icons/fa';

function Dashboard() {
    return (
        <div>
            <div className="navbar">
                <Link to="#" className='menu-bars'>
                    <AiFillDashboard/>
                </Link>
            </div>
        </div>
    )
}

export default Dashboard
